No one has treated my story with more care and accuracy. No one has ever talked about my gay bashing at 17. Every story told about me which does not come from my very own mouth is playwriting.  In 27 minutes Josh captured the bones of my story here. I’m immensely grateful for your care Josh. Inexplicably grateful to you Charles. Thank you both for this episode and, more so, for this series. May this just be the beginning. 
Folks you can watch, as much as I am aware, on @revrytv and it is free. 

