#tbt When I moved from Alternate to taking over the role of Hamilton full time, I would buy the cast @juicepress every single two show Wednesday. Randomly, on my way to rehearsal, I passed a Juice Press and saw our photos in a mural on their wall! So cute! So fun! Beautiful memories! And so thankful for health and wellness support from Juice Press throughout my run.❤️‍🔥
(That bottom pic is literally in my dressing room, mic on, pre matinee. Love it.)
