Folks, YOU MUST READ THIS! This has been on my queue forever and I finally finished it! Unexpected day off from rehearsals, cuddled up and finished this book. Talk about a beautiful way to shut out all the noise, hate, anti-trans, anti-LGBTQ+ BS, and nourish my heart with positive representation, positive messaging, uplifting visibility, and love, love, love. This is a beautiful banned book. Yes it is banned. So get your copy immediately!!! About to start the second book now but a little advice when you read, have a tissue handy. Your heart strings will be pulled.
@benjamin.alire.saenz @lin_manuel 
#lgbtq #representationmatters #love

