LGBTQ+ youth comprise 40% of all youth facing homelessness, while only making up 7%of the US population. Covenant House reaches far and wide to provide care and services to empower young folks to change their lives. It’s so much more than a safe place to sleep, and that alone is vital. Please consider supporting my Sleep Out by making a donation via the fundraising link above on my profile, or, via the link in my bio or stories.
Thank you so much folks! Together we can change lives❤️
