Til now, the @gq interview I did in 2016 has been my quintessential interview. However, this conversation we have here on @wasitchance connects dots and answers a hell of a lot of questions folks have who genuinely don’t know my story. 

From childhood to now, through health challenges, career detours, really almost everything. Truly this was beautifully done by @vickeryandco & @alanseales and I’m so grateful this exists. Thank you both, and if you have the time and interest, please give a listen via the link in my bio which will direct you to the Was It Chance homepage.

